import React, {useState} from 'react'
import {Link} from 'react-router-dom'
import {Row, Form } from 'react-bootstrap'





const Category = ({history}) => {
    const [keyword] = useState([])

    const onSubmitHandler = (e) => {
        e.preventDefault()
        if(keyword === '/'){
            history.push('/')
        }else{
            history.push(`/search/${keyword}`)
        }
    }

   

   

    return (
  
       
            <Form>
                <Row>
                    <Link className="btn btn-outline-primary my-3"to='/'>
                                All
                    </Link>
          
                    <Link className="btn btn-outline-primary my-3"to='/camera'>
                                카메라
                    </Link>
                    <Link className="btn btn-outline-primary my-3"to='/watch'>
                                시계
                    </Link>
                    <Link className="btn btn-outline-primary my-3"to='/toy'>
                                장난감
                    </Link>
                </Row>
            </Form>
   
    )
}

export default Category
